import React, { useState } from 'react';
import axios from 'axios';


const Starwarapi = props => {
    const [responseDatas, setResponseData] = useState([]);


    const callStarwarPeople = () => {
        axios.get(`https://swapi.dev/api/people`)
            .then(res => {
                setResponseData(res.name);
            })
            .catch(err => {
                console.log(err);
            });
    };

    return (


        <div>
            <div>
                <label>Search for:</label>
                <select>
                    <option onSelect={callStarwarPeople}>{setResponseData.people}</option>
                </select>
                <label>ID: </label>
                <input type="search" onSearch={(e) => {
                    return responseDatas.id
                }} />
            </div>
            {
                responseDatas.map((starwar) => {
                    return (
                        <div>
                            <span>{starwar.people}</span>
                        </div>
                    )
                })}
            {/* response.data.results */}
        </div>



    )
}

export default Starwarapi;
